import React from 'react';
import { Stethoscope, Users, Clock, Phone, MapPin } from 'lucide-react';

const ClinicLanding = () => {
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Hero Section with Background */}
      <div className="relative h-[500px] overflow-hidden bg-cover bg-center" style={{
        backgroundImage: 'url("/images/clinic-hero.jpg")'
      }}>
        <div className="absolute inset-0 bg-black/50 flex flex-col items-center justify-center text-center">
          <h1 className="text-4xl text-white font-bold drop-shadow-lg">Material Clinic</h1>
          <p className="text-lg text-gray-300 mt-2 drop-shadow-lg">Your Health, Our Priority â€“ The Ultimate Clinic Management Solution!</p>
        </div>
      </div>
      
      {/* Stats Cards - Always in Row */}
      <div className="container mt-8 pb-5">
        <div className="row justify-content-center">
          <div className="col-md-4 text-center">
            <div className="p-4 bg-gradient-to-r from-blue-500 to-blue-700 text-white rounded-lg shadow-lg">
              {/* <img src="/images/doctor.png" alt="Medical Specialist" className="w-16 mx-auto mb-2" /> */}
              <h2 className="h1">20+</h2>
              <p>Medical Specialists</p>
            </div>
          </div>

          <div className="col-md-4 text-center">
            <div className="p-4 bg-gradient-to-r from-green-500 to-green-700 text-white rounded-lg shadow-lg">
              {/* <img src="/images/patients.png" alt="Satisfied Patients" className="w-16 mx-auto mb-2" /> */}
              <h2 className="h1">15k+</h2>
              <p>Satisfied Patients</p>
            </div>
          </div>

          <div className="col-md-4 text-center">
            <div className="p-4 bg-gradient-to-r from-red-500 to-red-700 text-white rounded-lg shadow-lg">
              {/* <img src="/images/support.png" alt="Medical Support" className="w-16 mx-auto mb-2" /> */}
              <h2 className="h1">24/7</h2>
              <p>Medical Support</p>
            </div>
          </div>
        </div>
      </div>
      
      {/* Call to Action */}
      <div className="container my-10 text-center p-6 bg-gradient-to-r from-purple-500 to-purple-700 text-white rounded-lg shadow-lg">
        <h2 className="text-2xl font-bold">Join Our Clinic</h2>
        <p className="text-white my-2">Providing quality medical care with the best specialists.</p>
        <button className="bg-white text-purple-700 px-6 py-2 rounded-lg shadow-md hover:bg-gray-200">Get Started</button>
      </div>
    </div>
  );
};

export default ClinicLanding;
